import React, { Component } from 'react';
import { connect } from 'react-redux';
import './style.less';

class ReadyList extends Component{
    render(){
        return(
            <div className="readylist">
                <div className="list-head">
                    <div>播放列表</div>
                    <div>收藏全部</div>
                    <div>清空</div>
                </div>
                <ul className="list-body">

                </ul>
            </div>
        )
    }
}
export default ReadyList;
